import React from 'react';
import './App.css';
import AboutUs from './components/Footer/AboutUs';
import Footer from './components/Footer/Footer';
import Header from './components/Header/Header';
import { Chef, chefs } from './interfaces/chef';

function App() {

  return (
    <div className="App">
      {chefs.map((chef:Chef) => (
        <p>{chef.married}</p>
      ))}
      <Header/>
      <AboutUs/>
      <Footer/>
    </div>
  );
}

export default App;
